import './App.css';
import { useEffect, useState } from 'react';
import axios from "axios"
import Formtable from './components/Formtable';


function App() {
  const [addSection,setAddSection] = useState(false)
  const [editSection,setEditSection] = useState(false)
  const [formData,setFormData] = useState({
    RoomCode: "",
    Name: "",
    Temperature: "",
    ImageURL: "",
    FireStatus: "",
    GasStatus: "",
  })
  const [formDataEdit,setFormDataEdit] = useState({
    RoomCode: "",
    Name: "",
    Temperature: "",
    ImageURL: "",
    FireStatus: "",
    GasStatus: "",
  })
  const [dataList,setDataList] = useState([])

  const handleOnChange = (e)=>{
    const {value,name} = e.target
    setFormData((preve)=>{
        return{
          ...preve,
          [name] : value
        }
    })
  }


  const handleSubmit = async(e)=>{
      e.preventDefault()
      const data = await axios.post("http://localhost:8090/api/addHouse",formData)
      console.log(data)
      if(data.data.success){
          setAddSection(false)
          alert(data.data.message)
          getFetchData()
          setFormData({
            RoomCode: "",
            Name: "",
            ImageURL: "",
            Temperature: "",
            FireStatus: "",
            GasStatus: ""
          })

      }
  }
  const getFetchData = async()=>{
    const data = await axios.get("http://localhost:8090/api/listHouse")
    console.log(data)
    if(data.data.success){
        setDataList(data.data.data)
    }
  }
  useEffect(()=>{
    getFetchData()
  },[])

  const handleDelete = async (id) => {
    const data = await axios.delete("http://localhost:8090/api/deleteHouse/" + id);
    if (data.data.success) {
      getFetchData();
      alert(data.data.message);
    }
  };

  const handleUpdate = async(e)=>{
    e.preventDefault()
    const data = await axios.put("http://localhost:8090/api/updateHouse/",formDataEdit)
    if(data.data.success){
      getFetchData()
      alert(data.data.message)
      setEditSection(false)
    }
  }
  const handleEditOnChange = async(e)=>{
    const {value,name} = e.target
    setFormDataEdit((preve)=>{
        return{
          ...preve,
          [name] : value
        }
    })
  }
  const handleEdit = (el)=>{
    setFormDataEdit(el)
    setEditSection(true)
  }
  return (
   <>
      <div className="container">
        <button className="btn btn-add" onClick={()=>setAddSection(true)}>Add</button>

      {
        addSection && (
          <Formtable
            handleSubmit={handleSubmit}
            handleOnChange={handleOnChange}
            handleclose = {()=>setAddSection(false)}
            rest={formData}
          />
        )
      }
      {
        editSection && (
          <Formtable
            handleSubmit={handleUpdate}
            handleOnChange={handleEditOnChange}
            handleclose = {()=>setEditSection(false)}
            rest={formDataEdit}
          />
        )
      }


      <div className='tableContainer'>
        <table>
          <thead>
            <tr>
              <th>Room Code</th>
              <th>Name</th>
              <th>Temperature</th>
              <th>Image URL</th>
              <th>Fire Status</th>
              <th>Gas Status</th>
              <th>
              
              </th>
            </tr>
          </thead>
          <tbody>
            { dataList[0] ? (
              dataList.map((el)=>{
                console.log(el)
                return(
                  <tr key={el.RoomCode}>
                    <td>{el.RoomCode}</td>
                    <td>{el.Name}</td>
                    <td>{el.Temperature}</td>
                    <td>{el.ImageURL}</td>
                    <td>{el.FireStatus}</td>
                    <td>{el.GasStatus}</td>
                    <td>
                      <button className='btn btn-edit' onClick={()=>handleEdit(el)}>Edit</button>
                      <button className='btn btn-delete' onClick={()=>handleDelete(el.RoomCode)}>Delete</button>
                    </td>
                  </tr>
                )
              }))
              : (
                <tr>
                <td  style={{textAlign : "center"}}>No data</td>
                </tr>
              )
            }
          </tbody>
        </table>
      </div>
     


      </div>
   </>
  );
}

export default App;
